import React, { Component } from 'react'
import { Link } from 'react-router';
import './NavBar.css'

class NavBar extends Component {
    render(){
        return(

                    <nav className="navbar navbar-expand-lg fixed-top">
                      <a className="navbar-brand" href="https://">TimeOff Mgt App</a>
                      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="https://navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                      <i className="fas fa-bars"></i>
                      </button>
                      <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ml-auto">
                          <li className="nav-item nav-items text-center padtb5">
                            <Link className="nav-link" to="https://">LOGIN</Link>
                          </li>
                          <li className="nav-item navbar-button text-center">
                            <Link className="nav-link " to="/signup">REGISTER</Link>
                          </li>
                        </ul>
                      </div>
                    </nav>

        )
    }
}

export default NavBar;
